import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Hello World!
        </p>
        <h1>
          This is going to be a planner app
        </h1>
      </header>
    </div>
  );
}

export default App;
